var jkSelector="article";
var jkKeys={NEXT:"j",PREV:"k",};
var jkCodes={NEXT:jkKeys.NEXT.charCodeAt(),PREV:jkKeys.PREV.charCodeAt(),};

$(document).ready(function(){$(document).bind("keypress",function(b){function a(){var c=$(jkSelector).filter(":visible");var e=$("html, body");var d=null;c.each(function(g,h){var f=$(h).offset().top-$(window).scrollTop();if(f<0&&(e==null||f>$(e).offset().top-$(window).scrollTop())){e=h}if(f>0&&(d==null||f<$(d).offset().top-$(window).scrollTop())){d=h}});return{next:d,prev:e}}if(!b.which){return}if($(b.target).is(":input")){return}if(b.which==jkCodes.NEXT&&a().next!=null){$("html, body").scrollTop($(a().next).offset().top)}if(b.which==jkCodes.PREV&&a().prev!=null){$("html, body").scrollTop($(a().prev).offset().top)}})});